import React from "react";
import ReactDOM from "react-dom/client";

function App() {
    return (
        <div>
            <Header />
            <Pizza />
            <Pizza />
            <Pizza />
            <Footer />
        </div>
    )
}

function Header() {
    return <h2>Fast Pizza Delivery Co.</h2>
}

function Menu() { }

function Footer() {
    return (
        <div>
            const date = new Date().toLocalStorage
        </div>
    )
}

function Pizza() {
    return (
        <div>
            <h2>Biryani</h2>
            <p>Its delicious</p>
        </div>
    )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<React.StrictMode><App /></React.StrictMode>)
